import React from 'react';
import { View, Text } from 'react-native'; 

const App = () => {
  return(
    <View style={{
      backgroundColor: '#069',
      flex: 1,
      alignItems: "center",
      justifyContent: "center"
    }}>
      <Text>Alo DevSuperior!</Text>
      <Text>Francisco</Text>
      <Text>Aluno de React Native.</Text>
    </View>
  );
}

export default App;
